import React, { Component } from 'react'; 

class Contact extends Component {
    render() {
        return(
            <div>
                <h1 class="h1 contact">any questions?</h1>
                <p>Feel free to send a message below!</p>
                <form class="contact-form">
                    <label for="sender">Name: </label>
                    <input type="text" id="sender" placeholder="Your Name..."></input><br></br>
                    <label for="email">Email Address: </label>
                    <input type="text" id="email" placeholder="Your Email..."></input><br></br>
                    <label for="message">Message: </label>
                    <input type="text" id="message" placeholder="Your Message..."></input><br></br>
                    <input type="submit"></input>
                </form>
            </div>
        )                    
    }
}

export default Contact;
